import axios from "axios";

const API_URL = "http://localhost:8000/users";

export const fetchUsers = async () => {
  const res = await axios.get(API_URL);
  return res.data;
};

export const deleteUser = async (id) => {
  await axios.delete(`${API_URL}/${id}`);
};
